import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header className="bg-black p-4">
      <nav className="container mx-auto flex justify-center items-center">
        <div className="flex items-center space-x-9 text-white text-xl">
          <Link to="/our-story" className="nav-link">our story</Link>
          <Link to="/events" className="nav-link">events</Link>
        </div>
        <div className="flex justify-center mx-9 text-white font-bold"  style={{fontSize: 'clamp(1.5rem, 4vw, 6rem)'}}>
          the unplug club
        </div>
        <div className="flex items-center space-x-9 text-white text-xl">
          <Link to="/how-to-detox" className="nav-link">how to detox</Link>
          <Link to="/contact" className="nav-link">contact</Link>
        </div>
      </nav>
    </header>
  );
};

export default Header;
